INSERT INTO `curiousWorkbench_messagelibrary` VALUES ('msg_WelcomeMessage_1','1','Text','Hi there , Nice to meet you. I am Walnut. ','','','','',1),('msg_WelcomeMessage_2','1','Text','I find awesome skills relevant for you and help you acquire those skills everyday. ','http://www.walnutai.com/static/curiousWorkbench/images/walnuty.png','','','',2),('msg_WelcomeMessage_3','1','Buttons','First tell me a bit about you and we will get going.','http://www.walnutai.com/static/curiousWorkbench/images/walnuty.png','','Lets get started:GET_USER_LOCATION:P','',3),('msg_askUserLocation','1','Text','Your location helps me find skills, that companies near you are looking for. Give me a Zip code . Eg: 94404','','','','',4),('msg_ackUserLocation','1','Text','Thats [[actionGetLocationFromPin]]','','','','',5),('msg_askUserRole','1','Text','Tell me your role at work. If you dont find your role below just type it. We are  working fast to add more roles.','','','','text:Product Manager:ROLE_PRODUCT_MANAGER',6),('msg_askUserCompany','1','Text','And where do you work at ? Eg: Google Inc ','','','','',7),('msg_ackUserInfo','1','Text','Awesome, Thats good for now.','','','','',8),('msg_analyzeSkillInfo','1','Text','I analyzed 343 Product Manager job postings in your area. This is exciting .','','','','text:show me:SHOW_SKILL_STAT',9),('msg_roleDemandInfo','1','Text','[[actionGetRoleDemandInfo]]','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','Lets Self Eval:SELF_EVAL_SKILLS:P, More:SHOW_OPTIONS:P','',10),('msg_askSelfEvalSkills','1','Buttons','Rate your self on â€œProduct market fitâ€','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','I use it every day:RECORD_SKILL_EVAL:P,I am aware:RECORD_SKILL_EVAL:P,not sure:RECORD_SKILL_EVAL:P','',11),('msg_ackSkillInfo','1','Text','Got It! ','','','','',12),('msg_showOptions','1','Buttons','What would you like to do 